.dd-online-popup {
	position: fixed;
	z-index: 9999;
	width: 717px;
	left: 50%;
	top: 50%;
	margin-left: -365px;
	margin-top: -300px;
	-webkit-border-radius: 5px;
	-moz-border-radius: 5px;
	border-radius: 5px;
	-webkit-box-shadow: 0px 2px 6px 0px rgba(50, 50, 50, 0.75);
	-moz-box-shadow: 0px 2px 6px 0px rgba(50, 50, 50, 0.75);
	box-shadow: 0px 2px 6px 0px rgba(50, 50, 50, 0.75);
	display: none;
	background: #fff url(data:image/gif;base64,) center center no-repeat;
}

.dd-online-popup-Doctor {
	width: 732px;
	height: 475px;
}

.dd-online-popup-Diagnostic {
	width: 734px;
	background: #fff;
}

.dd-online-overlay {
	position: fixed;
	z-index: 8888;
	width: 100%;
	height: 100%;
	left: 0;
	top: 0;
	background: rgba(0, 0, 0, .5);
	display: none;
}